export function InfoTooltip(props) {
  return(
    <div className="popup popup_type_register popup_opend">
      <div className="popup__container">
        <button className="popup__close" type="button" aria-label="закрыть" onClick={props.onClose}></button>
        <div className="popup_state_done"></div>
        <h2 className="popup__title popup__title_register">Вы успешно зарегистрировались!</h2>
      </div>
    </div>
  )
}
